import React, { useState, useEffect } from 'react';
import { getMercadoAlerta, getHistoricoAlerta } from '../services/apiService';
import '../styles/AlertPanel.css';

const AlertPanel = ({ isVisible, onClose }) => {
  const [activeTab, setActiveTab] = useState('alertas');
  const [alertas, setAlertas] = useState([]);
  const [historico, setHistorico] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (isVisible) {
      loadData();
    }
  }, [isVisible]);

  const loadData = async () => {
    try {
      setLoading(true);
      const [alertasData, historicoData] = await Promise.all([
        getMercadoAlerta(),
        getHistoricoAlerta()
      ]);
      
      // ‚úÖ DEBUG: Ver qu√© llega
      console.log('üì¶ RAW alertasData:', alertasData);
      console.log('üì¶ RAW historicoData:', historicoData);
      console.log('‚úÖ alertasData es array?', Array.isArray(alertasData));
      
      setAlertas(Array.isArray(alertasData) ? alertasData : []);
      setHistorico(Array.isArray(historicoData) ? historicoData : []);
      
      console.log('‚úÖ Estado alertas:', Array.isArray(alertasData) ? alertasData.length : 0);
    } catch (error) {
      console.error('‚ùå Error al cargar alertas:', error);
      setAlertas([]);
      setHistorico([]);
    } finally {
      setLoading(false);
    }
  };

  // ‚úÖ DEBUG: Ver si el panel est√° visible
  console.log('üëÅÔ∏è Panel visible:', isVisible);
  console.log('üìä Cantidad de alertas:', alertas.length);

  return (
    <aside className={`alert-panel ${!isVisible ? 'hidden' : ''}`}>
      {/* Header */}
      <div className="alert-panel-header">
        <h3 className="alert-panel-title">üìä Alertas de Mercado</h3>
        <button className="alert-panel-close" onClick={onClose}>‚úï</button>
      </div>

      {/* Tabs */}
      <div className="alert-tabs">
        <button 
          className={`alert-tab ${activeTab === 'alertas' ? 'active' : ''}`}
          onClick={() => setActiveTab('alertas')}
        >
          Alertas Activas ({alertas.length})
        </button>
        <button 
          className={`alert-tab ${activeTab === 'historico' ? 'active' : ''}`}
          onClick={() => setActiveTab('historico')}
        >
          Hist√≥rico ({historico.length})
        </button>
      </div>

      {/* Content */}
      <div className="alert-panel-content">
        {loading ? (
          <div className="alert-loading">Cargando...</div>
        ) : (
          <>
            {activeTab === 'alertas' ? (
              <AlertasActivas data={alertas} />
            ) : (
              <HistoricoAlertas data={historico} />
            )}
          </>
        )}
      </div>
    </aside>
  );
};

// ‚úÖ Componente con TODOS los campos que me diste
const AlertasActivas = ({ data }) => {
  console.log('üîç AlertasActivas recibi√≥:', data);
  console.log('üîç Es array?', Array.isArray(data));
  console.log('üîç Longitud:', data?.length);

  if (!Array.isArray(data)) {
    return (
      <div className="alert-empty">
        ‚ö†Ô∏è Error: Los datos no son un array
        <pre style={{fontSize: '10px', marginTop: '10px'}}>
          {JSON.stringify(data, null, 2)}
        </pre>
      </div>
    );
  }

  if (data.length === 0) {
    return <div className="alert-empty">‚úÖ No hay alertas activas</div>;
  }

  return (
    <div className="alerts-list">
      {data.map((alerta, idx) => {
        // ‚úÖ TODOS LOS CAMPOS QUE ME DISTE
        const precioActual = Number(alerta.Precio) || 0;
        const precioAnterior = Number(alerta.PrecioAnterior) || 0;
        const diferencia = precioActual - precioAnterior;
        
        console.log(`Alerta ${idx}:`, {
          Nom_Eds: alerta.Nom_Eds,
          marca: alerta.marca,
          Precio: alerta.Precio,
          PrecioAnterior: alerta.PrecioAnterior,
          diferencia
        });
        
        return (
          <div key={idx} className={`alert-card ${alerta.Guerra_Precio === 'Si' ? 'guerra' : ''}`}>
            {/* Header */}
            <div className="alert-card-header">
              <span className={`alert-icon ${diferencia < 0 ? 'down' : 'up'}`}>
                {alerta.Guerra_Precio === 'Si' ? '‚ö†Ô∏è' : (diferencia < 0 ? 'üî¥' : 'üü¢')}
              </span>
              <div className="alert-card-info">
                <strong>{alerta.Nom_Eds}</strong>
                <span className="alert-marca">{alerta.marca} - {alerta.cod_cne}</span>
              </div>
              <span className={`alert-diff ${diferencia < 0 ? 'negative' : 'positive'}`}>
                {diferencia > 0 ? '+' : ''}{diferencia}
              </span>
            </div>

            {/* Detalles */}
            <div className="alert-card-details">
              <span>üíß {alerta.Combustible}</span>
              <span>üí∞ ${precioActual}</span>
              <span>üïê {alerta.Horario}</span>
              <span>üìç {alerta.tipo_atencion}</span>
            </div>

            {/* Fechas */}
            <div className="alert-card-dates">
              <span>üìÖ Actual: {alerta.Fecha}</span>
              <span>üìÖ Anterior: {alerta.FechaAnterior} (${precioAnterior})</span>
            </div>

            {/* Guerra de precio */}
            {alerta.Guerra_Precio === 'Si' && (
              <div className="alert-guerra-badge">
                ‚ö° GUERRA DE PRECIO
              </div>
            )}
          </div>
        );
      })}
    </div>
  );
};

// ‚úÖ Hist√≥rico con TODOS los campos
const HistoricoAlertas = ({ data }) => {
  console.log('üîç HistoricoAlertas recibi√≥:', data);

  if (!Array.isArray(data)) {
    return <div className="alert-empty">‚ö†Ô∏è Error: Los datos no son un array</div>;
  }

  if (data.length === 0) {
    return <div className="alert-empty">üìã No hay hist√≥rico disponible</div>;
  }

  return (
    <div className="historico-wrapper">
      <table className="historico-table">
        <thead>
          <tr>
            <th>Estaci√≥n</th>
            <th>Marca</th>
            <th>Comb.</th>
            <th>Precio</th>
            <th>Anterior</th>
            <th>Dif</th>
            <th>Tipo</th>
            <th>Fecha</th>
          </tr>
        </thead>
        <tbody>
          {data.slice(0, 100).map((item, idx) => {
            const precioActual = Number(item.Precio) || 0;
            const precioAnterior = Number(item.PrecioAnterior) || 0;
            const diferencia = precioActual - precioAnterior;
            
            return (
              <tr key={idx} className={item.Guerra_Precio === 'Si' ? 'guerra-row' : ''}>
                <td title={item.Nom_Eds}>{item.Nom_Eds?.slice(0, 20)}...</td>
                <td>{item.marca}</td>
                <td>{item.Combustible}</td>
                <td>${precioActual}</td>
                <td>${precioAnterior}</td>
                <td className={diferencia < 0 ? 'negative' : 'positive'}>
                  {diferencia > 0 ? '+' : ''}{diferencia}
                </td>
                <td>{item.tipo_atencion}</td>
                <td className="fecha-small">{item.Fecha}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
};

export default AlertPanel;
